-- ----------------------------
--  Table structure for `fc_esf`
-- ----------------------------
DROP TABLE IF EXISTS `fc_esf`;
CREATE TABLE `fc_esf` (
  `id` int(10) NOT NULL AUTO_INCREMENT COMMENT '基本信息id',
  `create_uid` int(10) NOT NULL DEFAULT '0' COMMENT '发布人id',
  `create_date` int(11) NOT NULL DEFAULT '0' COMMENT '发布时间',
  `write_date` int(11) NOT NULL DEFAULT '0' COMMENT '修改时间',
  `write_uid` int(10) NOT NULL COMMENT '修改人id',
  `flag` tinyint(1) NOT NULL DEFAULT '1' COMMENT '有效标志[0:无效 1:有效 9:待审]',
  `district_id` int(11) NOT NULL DEFAULT '0' COMMENT '小区ID',
  `title` varchar(255) DEFAULT NULL COMMENT '标题',
  `first_char` char(1) DEFAULT NULL COMMENT '小区首字母',
  `address` varchar(255) DEFAULT NULL COMMENT '房源地址',
  `house_type` tinyint(1) NOT NULL DEFAULT '1' COMMENT '房屋类别[1:出租 2:出售]',
  `reside` varchar(125) DEFAULT NULL COMMENT '物业名称,所在小区名,门牌号(district)',
  `pm_type` varchar(10) DEFAULT NULL COMMENT '物业类型(district)',
  `direction` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '方位(东西南北片区)(district)',
  `region` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '片区(district)',
  `borough` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '行政区域(district)',
  `circle` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '环线(district)',
  `toward` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '房屋朝向',
  `pright` int(5) unsigned NOT NULL DEFAULT '0' COMMENT '产权类别',
  `ting` tinyint(2) NOT NULL DEFAULT '0' COMMENT '客厅',
  `shi` tinyint(2) NOT NULL DEFAULT '0' COMMENT '室',
  `wei` tinyint(1) NOT NULL DEFAULT '0' COMMENT '卫生间',
  `porch` tinyint(2) NOT NULL DEFAULT '0' COMMENT '阳台',
  `house_struct` varchar(10) DEFAULT NULL COMMENT '户型结构*',
  `total_floor` smallint(4) NOT NULL DEFAULT '0' COMMENT '总楼层',
  `current_floor` smallint(4) NOT NULL DEFAULT '0' COMMENT '所在楼层',
  `build_year` smallint(4) NOT NULL DEFAULT '1900' COMMENT '建筑年代(district)',
  `total_area` decimal(8,2) NOT NULL DEFAULT '0.00' COMMENT '建筑面积',
  `out_area` decimal(8,2) NOT NULL DEFAULT '0.00' COMMENT '分摊面积',
  `fitmen_type` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '装修状况(1毛坯2精装)',
  `elevator` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否有电梯[0:无 1:有]',
  `is_tube` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '是否在地铁沿线',
  `selling_point` text COMMENT '房屋卖点',
  `note` text COMMENT '详细内容',
  `price` float(10,2) NOT NULL DEFAULT '0.00' COMMENT '总价(出租为租价，出售为售价)',
  `map_show` tinyint(1) NOT NULL DEFAULT '0' COMMENT '显示到地图[0:不显示 1:显示]',
  `telphone` varchar(255) DEFAULT NULL COMMENT '联系电话',
  `email` varchar(255) DEFAULT NULL COMMENT '联系人email',
  `qq` varchar(45) DEFAULT NULL COMMENT 'QQ',
  `msn` varchar(45) DEFAULT NULL COMMENT 'msn',
  `is_top` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否置顶，9系统设置，7为已经验房, 0为默认',
  `is_recommend` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否首页推荐',
  `fav_num` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '收藏数',
  `hits` int(10) NOT NULL DEFAULT '0' COMMENT '访问次数',
  `img_path` varchar(500) DEFAULT NULL COMMENT '默认图片',
  `img_num` int(10) DEFAULT '0' COMMENT '图片数',
  `refresh_date` int(11) NOT NULL DEFAULT '0' COMMENT '刷新时间',
  `limit_day` smallint(4) DEFAULT NULL COMMENT '有效天数',
  `rent_way` tinyint(1) unsigned DEFAULT '0' COMMENT '租赁方式1整租2合租',
  `rent_deposit` varchar(45) DEFAULT NULL COMMENT '押金(用于出租)',
  `rent_live_date` int(10) DEFAULT '0' COMMENT '入住时间(用于出租)',
  PRIMARY KEY (`id`),
  KEY `updated_at` (`refresh_date`),
  KEY `create_at` (`write_date`),
  KEY `borough` (`borough`),
  KEY `house_type` (`house_type`),
  KEY `room` (`shi`),
  KEY `is_recommend` (`is_recommend`),
  KEY `flag` (`flag`),
  KEY `user_id` (`create_uid`),
  KEY `is_top` (`is_top`)
) ENGINE=MyISAM AUTO_INCREMENT=5457 DEFAULT CHARSET=utf8 COMMENT='二手房';

