可以想象的，生意肯定不错，一晚上50元的收费标准，那就可以财源广进<br />\r<br />\r3.也可以经营一个网吧，学生的最爱，还可以经营餐饮或者其他生意<br />\r<br />\r4.如果作老人养老也是不错的选择，离景区就10几分钟的步行时间，对老人来说是一个很好的有氧运动，延年益寿那是必须的<br />\r<br />\r说了这些优点和好处，你可能会很奇怪这样好的房子干嘛要便宜出售呢？<br />\r<br />\r原因如此：房子是一栋房，一个楼梯，一家人居住最适宜，而当时是我和很好的朋友合伙买地修建，也就是属于我们两家人的房子，现在朋友还是想回老家发展，急于用钱，才出售房子，我也苦于没有钱买下她的房，所以只好我们一起把房出售，当然一个人买下来居住或投资是最好不过了，这点你想的到！<br />\r<br />\r有感兴趣的朋友请赶快联系我，实地带你看房去！       ', '/fang5/285322556x.htm', '56.00', '0', '13228158127', null, null, null, '0', '0', '0', '0', null, '0', '0', null, '0', null, '0'), ('1441', '0', '0', '1341123701', '0', '1', '2137', '南延线高档住宅小区业主原价急售', null, '楠香山', '2', '楠香山', ' 普通住宅', '0', '0', '510109', '0', '21503', '0', '2', '3', '2', '0', null, '2', '7', '1900', '125.00', '0.00', '21901', '0', '0', '\r       我是业主,2011年１２底收的房，诚购者价可看房　　此房是该盘楼王位置，套３变套４；实得面积140平,因急需用钱急售       ', '/fang5/285335245x.htm', '76.00', '0', '13398191216', null, null, null, '0', '0', '0', '0', 'http://image.ganjistatic1.com/gjfs02/M00/83/D8/wKhzRk,v7Mf6QCoNAAC2l8ndZOQ866_600-0_6-0.jpg', '0', '0', null, '0', null, '0'), ('1442', '0', '0', '1341122557', '0', '1', '2137', '温江金马石油苑二手房', null, '', '2', null, ' 普通住宅', '0', '0', '510123', '0', '21502', '0', '2', '4', '2', '0', null, '6', '5', '1900', '131.00', '0.00', '21901', '0', '0', '\r       小区位于金马镇，紧邻金马河畔，小区旁有医院、学校、菜市超市等，生活方便，交通便利。小区内环境优雅，绿化植被非常好，楼间距宽，停车便利，物管费合理。此房为5跃6，南北朝向，采光通透，户型好，有40平花园赠送，6楼有约40平屋顶可以使用，此房没有装修过，因此可按自己喜好装修，双证齐全。有意者清电话联系       ', '/fang5/285301778x.htm', '45.00', '0', '18782132195', null, null, null, '0', '0', '0', '0', 'http://image.ganjistatic1.com/gjfs02/M00/83/D8/wKhzRk,v7Mf6QCoNAAC2l8ndZOQ866_600-0_6-0.jpg', '0', '0', null, '0', null, '0'), ('1443', '0', '0', '1341122457', '0', '1', '1459', '青城山房屋出售', null, '青城阳光', '2', '青城阳光', ' 普通住宅', '0', '0', '510181', '0', '0', '0', '2', '2', '2', '0', null, '3', '3', '1900', '80.00', '0.00', '0', '0', '0', '\r       此房为3跃4，3楼露台：27平，4楼厅为赠送，面积：20平       ', '/fang5/285319456x.htm', '75.00', '0', '15378172021', null, null, null, '0', '0', '0'