后阳台花岗石梯步入内较方便，并且后面(公用)花园可自己使用,自种有各色花卉草木点缀该处，根据你的需要,还可随意修饰。投资分析：出租每月可租4000元～5000元。该房位处繁华市中心区位置，商务办事均十分方便. 宜作为外地单位驻蓉办事处.也可作商用投资(棋牌茶楼)等.随着城市建设的不断推行，该处的潜在升值空间无限。<br />\r业主卖房原因, 此房房产证去年才办而未满5年,是要交营业税的,但2012.07.01前的交税基数不高(约应交2.5万元营业税),而2012.07.01后成都将按成交价作计税基数,将比现多交几倍.因此,过了2012.07.01这个时点将不考虑再卖此房.若需要者,请尽快!       ', '/fang5/274985208x.htm', '155.00', '0', '18228092556', null, null, null, '0', '0', '0', '0', 'http://image.ganjistatic1.com/gjfs02/M00/1C/09/wKhzRk,d4mj3PdJUAAB-mUKGn5A460_600-0_6-0.jpg', '0', '0', null, '0', null, '0'), ('2299', '0', '0', '1339941378', '0', '1', '175', '郫县团结好房', null, '', '2', null, ' 普通住宅', '0', '0', '510124', '0', '0', '0', '1', '1', '1', '0', null, '6', '1', '1900', '52.00', '0.00', '21901', '0', '0', '\r       稀缺带花园小户型环境好       ', '/fang5/274996924x.htm', '19.00', '0', '13550179433', null, null, null, '0', '0', '0', '0', 'http://image.ganjistatic1.com/gjfs02/M00/1C/09/wKhzRk,d4mj3PdJUAAB-mUKGn5A460_600-0_6-0.jpg', '0', '0', null, '0', null, '0'), ('2300', '0', '0', '1339940378', '0', '1', '0', '三强北路街面门面房出售', null, '锦绣华都一期', '2', '锦绣华都一期', ' 普通住宅', '0', '0', '510122', '0', '21501', '0', '1', '1', '1', '0', null, '0', '7', '1900', '80.00', '0.00', '21902', '0', '0', '\r       三强北路大马路旁，增值空间特大。       ', '/fang5/274988035x.htm', '150.00', '0', '13908025734', null, null, null, '0', '0', '0', '0', 'http://image.ganjistatic1.com/gjfs02/M00/1C/09/wKhzRk,d4mj3PdJUAAB-mUKGn5A460_600-0_6-0.jpg', '0', '0', null, '0', null, '0'), ('2301', '0', '0', '1339936475', '0', '1', '0', '精装商务酒店式公寓出售', null, '', '2', null, ' 商住楼', '0', '0', '510108', '0', '21503', '0', '1', '1', '1', '0', null, '6', '2', '1900', '29.00', '0.00', '0', '0', '0', '\r       此房为精装商住楼 标间复试楼层 另送阳台面积 万象城对面 升值空间大       ', '/fang5/274951819x.htm', '28.00', '0', '13350089982', null, null, null, '0', '0', '0', '0', 'http://image.ganjistatic1.com/gjfs01/M00/AE/25/wKhxwU,dzkm6O3XoAAB8y66aL-c644_600-0_6-0.jpg', '0', '0', null, '0', null, '0'), ('2302', '0', '0', '1339936495', '0', '1', '515', '超温馨