体化、全方位的行车交通网络，与城市繁华无缝连接。此外以上锦颐园为中心，与成都相连的公交车路线有305、320、221、117、716、704、360等；与郫县各个城镇相连接的有：361、363、366、365、364、702、703、704等。       ', '/fang5/266228972x.htm', '63.00', '0', '13693427093', null, null, null, '0', '0', '0', '0', null, '0', '0', null, '0', null, '0');
