森邻的洋房退台被移转到了围合之外，围合内外的景观相互呼应，均好、互动。<br />\r<br />\r小区停车情况<br />\r停车位：891<br />\r停车费：200月/位<br />\r物管费：1.3元/㎡（花园洋房）1.5元/㎡（电梯）<br />\r容积率：1.45 绿化率：35.2% 欢迎来电咨询，<br />\r<br />\r最后请允许我衷心祝您早日买到称心如意的好房子，如果您对这套房子有兴趣可以联系我，非诚勿扰！！！       ', '/fang5/255153640x.htm', '102.00', '0', '18980077276', null, null, null, '0', '0', '0', '0', 'http://image.ganjistatic1.com/gjfs01/M00/29/8D/wKhxwE-zGS3T6Q65AABGhlof5Rw698_600-0_6-0.jpg', '0', '0', null, '0', null, '0'), ('3743', '0', '0', '1337667822', '0', '1', '0', '机会不要错过哦，最满意的住房', null, '', '2', null, ' 商住楼', '0', '0', '510104', '0', '0', '0', '1', '1', '1', '0', null, '2', '8', '1900', '53.00', '0.00', '21902', '0', '0', '\r       配套其全，交通方便。投资价值高       ', '/fang5/255147661x.htm', '45.00', '0', '13709005154', null, null, null, '0', '0', '0', '0', 'http://image.ganjistatic1.com/gjfs01/M00/29/8D/wKhxwE-zGS3T6Q65AABGhlof5Rw698_600-0_6-0.jpg', '0', '0', null, '0', null, '0'), ('3744', '0', '0', '1337667576', '0', '1', '1794', '地下室两套出售单面积63平米', null, '中央花园四期', '2', '中央花园四期', ' 普通住宅', '0', '0', '510107', '0', '21502', '0', '1', '2', '1', '0', null, '0', '6', '1900', '63.00', '0.00', '21902', '0', '0', '\r       1、该房屋位于地下室一层，两套内有门可开关通行。简单装修（含地砖，墙砖，防水，照明，门窗）通水，电，有线电视，室内无卫生间（可用小区内公用厕所或自行改造），不通天然气（可自行改造）。<br />\r2、室内无简单家电，无床，衣柜等生活用品。<br />\r3、可用于居住和仓储使用，两套总价24万。开发商业合同。       ', '/fang5/255143962x.htm', '12.00', '0', '13208192527', null, null, null, '0', '0', '0', '0', 'http://image.ganjistatic1.com/gjfs01/M00/29/8D/wKhxwE-zGS3T6Q65AABGhlof5Rw698_600-0_6-0.jpg', '0', '0', null, '0', null, '0'), ('3745', '0', '0', '1337667203', '0', '1', '1794', '新房出租 合能四季映像', null, '', '2', null, ' 商住楼', '0', '0', '510112', '0', '21502', '0', '2', '3', '1', '0', null, '4', '1', '1900', '69.00', '0.00', '21901', '0', '0', '\r       四条交通动脉直达市中心，驿都大道、成龙大道、三环路、地铁二号线（修建中），001、218、223、336、854、886等6条公共交通，另有全天滚动发车的社区班车，地铁2号线       ', '/fang5/255137827x.htm', '35.00', '0', '13551168588', null, null, null, '0', '0', '0', '0', 'http://image.ganjistatic1.com/gjfs01/M00/29/8